import React, { useState } from "react";
import axios from "axios";
import Back from "../components/common/back/Back";

const Notes = () => {
  const [imageName, setImageName] = useState("");
  const [imageLink, setImageLink] = useState("");
  const [hours, setHours] = useState("");
  const [starsCount, setStarsCount] = useState(0);
  const [link1, setLink1] = useState("");
  const [link2, setLink2] = useState("");
  const [link3, setLink3] = useState("");
  const [finalLink, setFinalLink] = useState("");

  const handleAddProduct = async () => {
    try {
      const response = await axios.post("http://localhost:8000/add/course", {
        imageName,
        imageLink,
        hours,
        starsCount,
        link1,
        link2,
        link3,
        finalLink,
      });

      if (response.status === 201) {
        alert("Product added successfully");
        window.location.reload();
      } else {
        console.error("Failed to add product");
      }
    } catch (error) {
      console.error("Error adding product:", error);
    }
  };

  return (
    <div className="  flex  flex-col justify-center items-center">
      <Back title="Assignment & Notes" />

      <div className="flex justify-center text-black mb-5 items-center ">
        <div className="flex flex-col items-center space-y-4">
          <h1 className="text-2xl font-bold">Add Product</h1>

          <input
            type="text"
            placeholder="Image Name"
            value={imageName}
            onChange={(e) => setImageName(e.target.value)}
            className="w-full px-4 py-2 text-black bg-gray-200 rounded-md shadow-md focus:outline-none focus:ring-2 focus:ring-gray-500"
          />
          <input
            type="text"
            placeholder="Image Link"
            value={imageLink}
            onChange={(e) => setImageLink(e.target.value)}
            className="w-full px-4 py-2 text-black bg-gray-200 rounded-md shadow-md focus:outline-none focus:ring-2 focus:ring-gray-500"
          />
          <input
            type="text"
            placeholder="Hours"
            value={hours}
            onChange={(e) => setHours(e.target.value)}
            className="w-full px-4 py-2 text-black bg-gray-200 rounded-md shadow-md focus:outline-none focus:ring-2 focus:ring-gray-500"
          />
          <input
            type="number"
            placeholder="Stars Count"
            value={starsCount}
            onChange={(e) => setStarsCount(e.target.value)}
            className="w-full px-4 py-2 text-black bg-gray-200 rounded-md shadow-md focus:outline-none focus:ring-2 focus:ring-gray-500"
          />
          <input
            type="text"
            placeholder="Link 1"
            value={link1}
            onChange={(e) => setLink1(e.target.value)}
            className="w-full px-4 py-2 text-black bg-gray-200 rounded-md shadow-md focus:outline-none focus:ring-2 focus:ring-gray-500"
          />
          <input
            type="text"
            placeholder="Link 2"
            value={link2}
            onChange={(e) => setLink2(e.target.value)}
            className="w-full px-4 py-2 text-black bg-gray-200 rounded-md shadow-md focus:outline-none focus:ring-2 focus:ring-gray-500"
          />
          <input
            type="text"
            placeholder="Link 3"
            value={link3}
            onChange={(e) => setLink3(e.target.value)}
            className="w-full px-4 py-2 text-black bg-gray-200 rounded-md shadow-md focus:outline-none focus:ring-2 focus:ring-gray-500"
          />
          <input
            type="text"
            placeholder="Final Link"
            value={finalLink}
            onChange={(e) => setFinalLink(e.target.value)}
            className="w-full px-4 py-2 text-black bg-gray-200 rounded-md shadow-md focus:outline-none focus:ring-2 focus:ring-gray-500"
          />
          <button
            onClick={handleAddProduct}
            className="w-full px-4 py-2 bg-blue-500 text-white rounded-md shadow-md hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500"
          >
            Add Product
          </button>
        </div>
      </div>
    </div>
  );
};

export default Notes;
